nxt_int_t nxt_http_parse_fuzz(nxt_str_t *request, nxt_lvlhsh_t *hash){

    nxt_mp_t                  *mp;
    nxt_buf_mem_t             buf;
    nxt_http_request_parse_t  rp;

    buf.start = request->start;
    buf.end = request->start + request->length;

    nxt_memzero(&rp, sizeof(nxt_http_request_parse_t));

    mp = nxt_mp_create(1024, 128, 256, 32);

    nxt_http_parse_request_init(&rp, mp);

    buf.pos = buf.start;
    buf.free = buf.end;

    if (nxt_slow_path(nxt_http_parse_request(&rp, &buf) == NXT_DONE)) {
        nxt_http_fields_process(rp.fields, hash, NULL);
    }

    nxt_mp_destroy(mp);

    return NXT_OK;
}

int stun_is_command_message_str(const uint8_t *buf, size_t blen) {
  if (buf && blen >= STUN_HEADER_LENGTH) {
    if (!STUN_VALID_CHANNEL(nswap16(((const uint16_t *)buf)[0]))) {
      if ((((uint8_t)buf[0]) & ((uint8_t)(0xC0))) == 0) {
        if (nswap32(((const uint32_t *)(buf))[1]) == STUN_MAGIC_COOKIE) {
          uint16_t len = nswap16(((const uint16_t *)(buf))[1]);
          if ((len & 0x0003) == 0) {
            if ((size_t)(len + STUN_HEADER_LENGTH) == blen) {
              return 1;
            }
          }
        }
      }
    }
  }
  return 0;
}

